import React, { Component } from 'react'
import downArrow from '../assets/images/down-arrow.svg'


export class CTABanner extends Component {
    render() {
        return (
            <div className="cta" >


                <div className="padding-bottom-top-60 cta-container" >

                    <p style={{ color: '#fff', fontFamily: 'Ubuntu', fontSize: '2.5em', fontWeight: 700 }}>Ready to get Started?</p>
                    <p style={{ color: '#fff', fontFamily: 'Lato', fontSize: '1.2em', fontWeight: 500 }}>Contact us below and we will setup a phone call to give you a quote and discuss more details.</p>
                    <a href="#contact"><img className="cta-down padding-top-20" style={{ width: '18pt', height: 'auto' }} src={downArrow}></img></a>

                </div>

            </div>

        )
    }
}

export default CTABanner
